import React, { useState } from 'react';
import './App.css';

function App() {
  const [message, setMessage] = useState('');

  const handleInsertData = async () => {
    try {
      const response = await fetch('http://localhost:3000/admin/insert-quiz-data', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ /* data if needed */ }),
      });

      const data = await response.text();
      setMessage(data); // Display response message from backend
    } catch (error) {
      console.error('Error:', error);
      setMessage('Error inserting quiz data');
    }
  };

  return (
    <div className="App">
      <h1>Admin Panel</h1>
      <button onClick={handleInsertData}>Insert Quiz Data</button>
      <p>{message}</p>
    </div>
  );
}

export default App;
